import "./Markers.css"
import { Marker, Popup } from 'react-leaflet'

import { useState, useCallback, useRef, useMemo } from "react"

const center = {
	lat: 44.119370,
	lng: 15.231365,
  }

function Markers() {

	return (
		<Marker position={[51.505, -0.09]}>
		<Popup>
		  A pretty CSS3 popup. <br /> Easily customizable.
		</Popup>
	  </Marker>
	)
  }

export default Markers
